import React from "react";

import "../../styles/compStyles/welcomeStyle.css";
export default props => {

    return (
        <>
        <div className="welcomewrap">
            <div className="welcomelogowrap">
                <div style={{"height":"100px","width":"100px","border":"3px solid black"}}></div>
            </div>
            <div className="welcomebtns">
                <div className="welcomebtn1"></div>
                <div className="welcomebtn2"></div>
            </div>
        </div>
        </>
    )
}
